import { useEffect, useState } from "react";

const NotesList = () => {

    const [notes, setNotes] = useState([
        {title: "First Note", body: "My note desc", category: "vacation", id: 1},
        {title: "Second Note", body: "My note desc", category: "vacation", id: 2},
        {title: "Third Note", body: "My note desc", category: "vacation", id: 2},
    ])

    useEffect(() => {
        NotesService.getAll()
            .then(response => {
                console.log('printing response', response.data);
            })
    })

    return ( 
        <div>
            <h1>List of notes</h1>
            {
                notes.map(note => (
                    <div>
                        <p>{note.title}</p>
                        <p>{note.body}</p>
                    </div>
                ))
            }
        </div>
     );
}

export default NotesList;
